import React from "react";
import "./style.css";

export default function Modal({ visability, info, setState }) {

    if(!visability){
      
    } else {
        document.onClick(setState)
    }

  return (
    <div className={visability 
    ? "modal-visable" 
    : "modal-not-visable"}
    id="modal"><h1>{info.title}</h1>
    <p>{info.desc}</p>

        {info.github ? 
        <p><a href={info.link} target="_blank">View on GitHub</a></p>  : <></>
        }

        {info.livelink ? 
        <p><a href={info.livelink} target="_blank">View Live</a></p>  : <></>
        }
      

    
    </div>
  );
}
